import React, { Component } from "react";
import {
  MDBBtn,
  MDBCard,
  MDBCardBody,
  MDBCardImage,
  MDBCardTitle,
  MDBCardText,
  MDBRow,
  MDBCol,
  MDBTable,
  MDBRating,
} from "mdbreact";

class StatisticsForProducts extends Component {
  state = {
    rates: [
      { category: "Taste", score: 5 },
      { category: "Smell", score: 4 },
    ],
  };
  render() {
    return (
      <div>
        <MDBCard>
          {this.state.rates.map((rate) => (
            <MDBCard>
              <MDBCardTitle>{rate.category}</MDBCardTitle>
              <MDBCardText id="score">{rate.score}</MDBCardText>
              <MDBRating getValue="5"></MDBRating>
            </MDBCard>
          ))}
        </MDBCard>
      </div>
    );
  }
}

export default StatisticsForProducts;
